import React from 'react';
const Card= (props)=>{
  const {name,email}= props;
    return(
        <div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='robots' src ={`https://robohash.org/${props.id}?set=set4&size=200x200`}/>
